function Deals() {
 const purple = "white"
 const [input , output] = useState(purple);
 const [name , setName] = useState('Buying')
 const [names , setNames] = useState('Selling')
 const changeCol=()=>{
  let color = "#0071DF";
  output(color);
  let txt = "Buying";
  setName(txt)
  
 }
 const changeCol1=()=>{
  let color1 = "#34495e";
  output(color1);
  setNames("setName ğŸ‘")
  
 }
 return (
  <div >
   <button type="submit" className="button-adj"
   onClick={changeCol} style={{backgroundColor:input , color:name}}>{name}</button>
   <button type="submit" className="button-adj1" onDoubleClick={changeCol1} style={{backgroundColor:input , color:names}}>Selling</button>
  </div>
 )
}

export default Deals
